import React, { Component } from 'react';
import LoginPage from './LoginPage/LoginPage';
import './App.css';

class App extends Component {
  constructor(props){
    super(props)
    this.state = {
      resultsComputed: false,
    }
  }

  renderLoginPage(){ 
    return (
      <LoginPage></LoginPage>
    );
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          {this.renderLoginPage()}
        </header>
      </div>
    );
  }
}

export default App;
